import React from "react";
import { Outlet } from "react-router-dom";
import Header from "../components/Header/Header";
import Footer from "../components/Footer/Footer";

function View() {
  return (
    <div className="flex-1 flex flex-col min-h-screen">
      <Header />

      <main className="">
        <Outlet />
      </main>

      <Footer />
    </div>
  );
}

export default View;
